        dup40 = dup37*MW*SB*UASfC(All3,gno1,tH) + 
     &    3*CW*Mf(tH,gno1)*UASfC(All3,3 + gno1,tH)*ZNeu(Neu3,4)

        dup41 = dup38*MW*SB*UASf(All3,gno2,tH) + 
     &    3*CW*Mf(tH,gno2)*UASf(All3,3 + gno2,tH)*ZNeuC(Neu3,4)

        dup42 = 4*MW*SB*SW*UASfC(All3,3 + gno1,tH)*
     &     ZNeuC(Neu3,1) - 
     &    3*CW*Mf(tH,gno1)*UASfC(All3,gno1,tH)*ZNeuC(Neu3,4)

        dZfR1(3,gno1,gno2) = 
     &   dZfR1(3,gno1,gno2) - 
     &    1/(36.D0*Pi)*(AlfaMZ*
     &        ((dup39*dup40*Mf(tH,gno1) + dup41*dup42*Mf(tH,gno2))*
     &           MNeu(Neu3)*
     &           Re(B0(Mf2(tH,gno2),MASf2(All3,tH),MNeu2(Neu3))) + 
     &          Mf(tH,gno2)*
     &           (dup40*dup41*Mf(tH,gno1) + 
     &             dup39*dup42*Mf(tH,gno2))*
     &           Re(B1(Mf2(tH,gno2),MNeu2(Neu3),MASf2(All3,tH)))))/
     &      (CW2*MW2*SB2*SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(All3)
	ENDLOOP(Neu3)

	LOOP(Cha3, 1,2,1)
	LOOP(All3, 1,6,1)

	tmp34 = B0(Mf2(tH,gno2),MASf2(All3,bH),MCha2(Cha3))

	tmp35 = B1(Mf2(tH,gno2),MCha2(Cha3),MASf2(All3,bH))

	LOOP(Ind2, 1,3,1)
	LOOP(Ind1, 1,3,1)

        dZfR1(3,gno1,gno2) = 
     &   dZfR1(3,gno1,gno2) - 
     &    1/(8.D0*Pi**2)*(ELMZ**2*Mf(tH,gno1)*Mf(tH,gno2)*
     &        (1/sqrt2*(MCha(Cha3)*Re(tmp34)*
     &              (CKM(gno1,Ind1)*CKMC(gno2,Ind2)*
     &                 UASf(All3,Ind2,bH)*
     &                 (-(sqrt2*
     &                      (Mf(bH,Ind1)*UASfC(All3,3 + Ind1,bH)*
     &                       UCha(Cha3,2))) + 
     &                   2*CB*MW*UASfC(All3,Ind1,bH)*UCha(Cha3,1))*
     &                 VCha(Cha3,2) + 
     &                CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &                 UASfC(All3,Ind2,bH)*
     &                 (-(sqrt2*
     &                      (Mf(bH,Ind1)*UASf(All3,3 + Ind1,bH)*
     &                       UChaC(Cha3,2))) + 
     &                   2*CB*MW*UASf(All3,Ind1,bH)*UChaC(Cha3,1))*
     &                 VChaC(Cha3,2)))/S2B + 
     &          (Re(tmp35)*
     &             (CKM(gno1,Ind2)*CKMC(gno2,Ind1)*
     &                (UASf(All3,Ind1,bH)*
     &                   (-(2*sqrt2*
     &                       (CB*MW*SB2*Mf(bH,Ind2)*
     &                       UASfC(All3,3 + Ind2,bH)*UCha(Cha3,2)))
     &                       + MW2*S2B**2*UASfC(All3,Ind2,bH)*
     &                      UCha(Cha3,1))*UChaC(Cha3,1) - 
     &                  2*SB2*Mf(bH,Ind1)*UASf(All3,3 + Ind1,bH)*
     &                   (sqrt2*
     &                      (CB*MW*UASfC(All3,Ind2,bH)*
     &                       UCha(Cha3,1)) - 
     &                     Mf(bH,Ind2)*UASfC(All3,3 + Ind2,bH)*
     &                      UCha(Cha3,2))*UChaC(Cha3,2)) + 
     &               2*CB2*CKM(gno1,Ind1)*CKMC(gno2,Ind2)*
     &                Mf2(tH,gno2)*UASf(All3,Ind2,bH)*
     &                UASfC(All3,Ind1,bH)*VCha(Cha3,2)*
     &                VChaC(Cha3,2)))/S2B**2))/
     &      (MW2*SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(Ind1)
	ENDLOOP(Ind2)

	ENDLOOP(All3)
	ENDLOOP(Cha3)

#ifdef DETAILED_DEBUG
	DCOUP "CalcRenConst: dZfR1(3,gno1,gno2) =", dZfR1(3,gno1,gno2) ENDL
#endif

	endif

	ENDLOOP(gno2)

	ENDLOOP(gno1)

	end
